    false,nt"url": null,nt"notes": "NODC Accession 0130918 contains raw underway
    meteorological, navigational, physical and time series data logged by the Scientific
    Computer System (SCS) aboard the NOAA Ship Rainier in the Beaufort Sea and Bering
    Sea from 2015-07-07 to 2015-07-23. Office of Marine and Aviation Operations (OMAO)
    personnel aboard the ship submitted these data and associated metadata to NODC.
    In addition, NODC Accession 0130918 contains supplementary cruise-level metadata,
    which OMAO personnel logged in the Ship Daily Activity Log (SDAL). OMAO and NODC
    personnel developed the automated process to archive these data under the auspices
    of the NOAA Rolling Deck to Repository (NOAA R2R) program.",nt"owner_org":
